import { Text, View } from "react-native";
import { TextInput, Button } from "react-native-paper";
import AsyncStorage from "@react-native-async-storage/async-storage";
import { useState } from "react";
import { styles } from "../assets/styles/styles";

// const rents = [{rentNumber: "1012",userName: "luismm",plateNumber: "1010",rentDate: "30/04/2023",}];

export default function RentScreen({ navigation }) {
  const [formDataRent, setformDataRent] = useState(defaultFormValues());
  const [errorMess, setErrorMess] = useState("");
  const [arrayRent,SetArrayRent] = useState([]);

  const onChange = (e, type) => {
    setformDataRent({ ...formDataRent, [type]: e });
  };

  //Funcion que obtiene los datos del Screen CarScreen
  const getValuesCars = async () => {
    let values = await AsyncStorage.getItem("keyCar");
    return new Promise((resolve, reject) => {
      if (values.length === 0) {
        reject(new Error("No existen datos"));
      } else {
        setTimeout(() => {
          resolve(JSON.parse(values));
        }, 1500);
      }
    });
  };

  let sw = 0;

  function setRentCars() {
    const valuesCars = getValuesCars();
    valuesCars
      .then((values) => {
        console.log(values);
        if (values.length != undefined) {
          let findPlateNumber = values.find((value) => formDataRent.plateNumber == value.plateNumber && value.stateCar);
          // console.log(findUser);
          console.log(findPlateNumber);
          values.forEach((srPlate) => {
            if (srPlate.plateNumber === searchPlate)
              values.plateNumber = searchPlate;
          });
          //Condiciones
          if (formDataRent.rentNumber === "" || formDataRent.userName === "" || formDataRent.plateNumber === "" || formDataRent.rentDate === "") {
            setErrorMess("Se debe ingresar todos los campos");
          } else if (findPlateNumber != undefined) {
            setErrorMess("La placa ingresada ya existe");
          } else {
            setErrorMess("Registrado Exitosamente");
            values.push({name: formDataRent.name,email: formDataRent.email,userName: formDataRent.userName,password: formDataRent.password,confPassword: formDataRent.confPassword,
            });
            // Se envia el arreglo por medio del metodo AsyncStorage para la validacion en el Screen LoginScreen
            AsyncStorage.setItem("keyRent", JSON.stringify(values));
            console.log(values);
            setTimeout(() => {
              navigation.navigate("Login");
            }, 3000);
          }
        }
      })
      .catch((Error) => {
        console.log(Error.message);
        if (formDataRent.rentNumber === "" || formDataRent.userName === "" || formDataRent.plateNumber === "" || formDataRent.rentDate === "") {
          setErrorMess("Se debe ingresar todos los campos");
        } else {
          let rentObj = [{rentNumber: formDataRent.rentNumber,userName: formDataRent.userName,plateNumber: formDataRent.plateNumber,rentDate: formDataRent.rentDate,stateCar: formDataRent.stateCar}];
          AsyncStorage.setItem("keyRent", JSON.stringify(rentObj));
          setErrorMess("Renta guardada");
        }
      });
  }

  let Limpiar = () => {};

  return (
    <View style={[styles.container, { backgroundColor: "#D2EDFF" }]}>
      <Text style={{ fontWeight: "bold" }}>Renta de Carros</Text>
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#000000"
        outlineColor="#000000"
        label="Nro Placa"
        mode="outlined"
        onChangeText={(plateNumber) => {
            const valuesCars = getValuesCars();
            valuesCars
            .then((values)=>{
                let validarPlaca = values.find((x) => x.plateNumber === plateNumber);
                if (validarPlaca) {
                setErrorMess("Placa encontrada");
                onChange(plateNumber, "plateNumber")
              } else {
                setErrorMess("Paila");
              }
            }).catch((Error)=>{
                setErrorMess("Placa NO encontrada");
            })
        }}
        defaultValue={formDataRent.plateNumber}
      />
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#000000"
        outlineColor="#000000"
        label="Usuario"
        mode="outlined"
        onChangeText={(e) => onChange(e, "userName")}
        defaultValue={formDataRent.userName}
      />
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#000000"
        outlineColor="#000000"
        label="Nro Renta"
        mode="outlined"
        onChangeText={(e) => onChange(e, "rentNumber")}
        defaultValue={formDataRent.rentNumber}
      />
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#000000"
        outlineColor="#000000"
        label="Fecha Renta"
        mode="outlined"
        onChangeText={(e) => onChange(e, "rentDate")}
        defaultValue={formDataRent.rentDate}
      />
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#000000"
        outlineColor="#000000"
        label="Estado"
        mode="outlined"
        onChangeText={(e) => onChange(e, "rentDate")}
        defaultValue={formDataRent.stateCar}
      />
      <View style={[{ backgroundColor: "#D2EDFF", flexDirection: "row" }]}>
        <Button
          style={{ marginTop: 10, marginEnd: 10 }}
          icon="login"
          mode="contained"
          buttonColor="#0076C2"
          onPress={() => {
            setRentCars();
          }}
        >
          Guardar
        </Button>
        <Button
          style={{ marginTop: 10 }}
          icon="login"
          mode="contained"
          buttonColor="#0076C2"
          //onPress={searchRent}
        >
          Listar
        </Button>
      </View>
      <Button
        textColor="#0076C2"
        onPress={Limpiar}
        //     onPress={()=>{
        //         navigation.navigate('Listar')
        // }}
      >
        Limpiar
      </Button>
      <Text style={{ fontWeight: "bold", marginTop: 10, color: "red" }}>
        {errorMess}
      </Text>
    </View>
  );
}

const defaultFormValues = () => {
  return {
    rentNumber: "",
    userName: "",
    plateNumber: "",
    rentDate: "",
    stateCar: "",
  };
};
